import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart
    // Using a specific product to ensure predictability
    const firstProductCard = page.locator('.product-card').first();
    await firstProductCard.waitFor({ state: 'visible' });
    await firstProductCard.getByRole('button', { name: 'Add to Cart' }).click();

    // Wait for the notification to appear and disappear, indicating the action is complete
    await page.waitForSelector('.notification.success.show');
    await page.waitForSelector('.notification.success', { state: 'hidden' });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    // The cart div contains text like "1 Cart"
    const cartButton = page.locator('div.cart:has-text("Cart")');
    await cartButton.click();

    // 3. Wait for the cart modal to be visible
    const cartModal = page.locator('#cartModal');
    await cartModal.waitFor({ state: 'visible' });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // 4. Update the quantity of the first item in the cart
    const firstCartItem = cartModal.locator('.cart-item').first();
    const initialQuantity = await firstCartItem.locator('span.quantity').textContent();

    // Find the increase quantity button (+) and click it
    const increaseButton = firstCartItem.getByRole('button', { name: '+' });
    await increaseButton.click();

    // 5. Verify the quantity has been updated
    // The updateCartQuantity function re-renders the cart, so we wait for the text to change
    const expectedQuantity = (parseInt(initialQuantity, 10) + 1).toString();
    const quantitySpan = firstCartItem.locator('span.quantity');
    await quantitySpan.waitFor(element => element.textContent === expectedQuantity, { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    const finalQuantity = await quantitySpan.textContent();

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2.",
      extractedData: {
        initialQuantity: initialQuantity,
        finalQuantity: finalQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
